import React from 'react'
import Inputlogin from '../../Organisms/Inputlogin/Inputlogin'

const Login = () =>{
    const test = (user, password) => {
        window.alert(user)
        window.alert(password)
    }
    return(
        <div id='Login'>
            <Inputlogin func={test}/>
        </div>
    )
}

export default Login
